import logo from './logo.svg';
import './App.css';

function Feature(){
	return (
		<div>
		<header className="App-header">
		<h1>Day la test 1</h1>
		<img src={logo} className="App-logo" alt="logo" />
		<p>
			Edit <code>src/App.js</code> and save to reload. <br/>
			ababss
		</p>
		<a
			className="App-link"
			href="https://reactjs.org"
			target="_blank"
			rel="noopener noreferrer"
		>
			Learn React
		</a>
		</header>
		</div>
	)
}

function App() {
	return (
	<div>
		<Feature></Feature>
	</div>
	);
}


export default App;
